  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Detroit
  River International Wildlife Refuge summarizes Refuge activities during the 2014
  calendar year. The report begins with a letter from Congressman John Dingell. Followed
  by an introduction to the Refuge and a summary of habitat conservation efforts.
  \ Information about research and monitoring including the 32nd consecutive year
  of Hawk Watch monitoring. Community engagement efforts are discussed along with
  capacity building efforts. Lastly, upcoming activities and investments are summarized.\",\n\t\"license_title\":
